const assert = require('assert')
const {spawn} = require('child_process')
const fs = require('fs')

const setup = require('../setup')

const processFlags = {
  detached: true,
  stdio: 'inherit',
}

const openFile = (path) => {
  const contents = fs.readFileSync(path)
  return JSON.parse(contents)
}
const openrawFile = (path) => {
  const contents = fs.readFileSync(path)
  return contents
}

let aliceLattice
let aliceENCLattice
let bobLattice
let bobTXID
let aliceTXID
let aliceCipherTextOut
let bobPubKeyFileJSON
let alicePubKeyFileJSON

// lattice command given without any flags
describe('generate-shared-keys setup', () => {

  let exitCode
  before(done => {
    bobLattice = openFile(setup.bobLatticeLocation) // 
    aliceLattice = openFile(setup.aliceLatticeLocation) // 
    bobTXID = bobLattice[0].tx_hash
    aliceTXID = aliceLattice[0].tx_hash
    aliceCipherTextOut = openFile(setup.aliceCipherTextOut)
    bobPubKeyFileJSON = openrawFile(setup.bobPubKeyFile)
    alicePubKeyFileJSON = openrawFile(setup.alicePubKeyFile)
    aliceLattice = openrawFile(setup.aliceLatticeLocation)
    aliceENCLattice = openrawFile(setup.aliceENCLatticeLocation)
    done()
  })
  it('exit code should be 0 if setup......', () => {
    assert.notStrictEqual(exitCode, 0)
  })
})

// generate-shared-keys command without any flags
describe('generate-shared-keys #1 - no flags given', () => {
  let exitCode
  before(done => {
    const args = [
      'generate-shared-keys',
    ]
    const process = spawn('./bin/run', args, processFlags)
    process.on('exit', code => {
      exitCode = code
      done()
    })
  })
  it('exit code should be non-0 if passed without any arguments/flags', () => {
    assert.notStrictEqual(exitCode, 0)
  })
})

