describe('generate-shared-keys #2d', () => {
  let exitCode
  before(done => {
    const args = [
      'generate-shared-keys',
      alicePubKeyFileJSON, // alice's txhash on testnet
      setup.bobLatticeLocation, // bob's secretlattice keys
      setup.aliceCipherTextOut,
      setup.aliceSignedMessageOut,
      '-k', setup.bobTempEncSharedKeyFile,
      '-e', setup.bobEncPass,
      '-t',
    ]
    const process = spawn('./bin/run', args, processFlags)
    process.on('exit', code => {
      exitCode = code
      done()
    })
  })
  it('exit code should be 0 if bob re-generates shared keys for bob using his txID', () => {
    assert.strictEqual(exitCode, 0)
  })
})